import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
      <nav className="navbar navbar-expand-lg bg-body-tertiary">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">GOLDSWORTH</a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div id="elements" className="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div className="navbar-nav">
            <a className="nav-link" aria-current="page" href="#">Home</a>
            <a className="nav-link" href="#">About</a>
            <a className="nav-link" href="#">Courses</a>
            <a className="nav-link" href="#">Discussion</a>
            <a className="nav-link" href="#">Contact</a>
            <button type="button" id="login-btn" className="btn btn-success">log-in</button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
